package net.jeeshop.services.manage.Integral.dao;import java.util.List;import net.jeeshop.core.dao.BaseDao;import net.jeeshop.core.dao.page.PagerModel;import net.jeeshop.services.common.Integral;public class IntegralDaoImpl implements IntegralDao {	private BaseDao dao;	public void setDao(BaseDao dao) {		this.dao = dao;	}	@Override	public PagerModel selectPageList(Integral e) {		return dao.selectPageList("front.integral.selectPageList",				"front.integral.selectPageCount", e);	}	@Override	public List selectList(Integral e) {		return dao.selectList("front.integral.selectList", e);	}	@Override	public Integral selectOne(Integral e) {		return (Integral) dao.selectOne("front.integral.selectOne", e);	}	@Override	public int delete(Integral e) {		return dao.delete("front.integral.delete", e);	}	@Override	public int update(Integral e) {		return dao.update("front.integral.update", e);	}		@Override	public int insert(Integral e) {		return dao.insert("front.integral.insert", e);	}	@Override	public int deleteById(int id) {		return dao.delete("front.integral.deleteById", id);	}	@Override	public Integral selectById(String id) {		return (Integral) dao.selectOne("front.integral.selectById", id);	}}